{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/vinikuhlmann/modelling-stocks-with-arma-egarch?scriptVersionId=165931954\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"a9075184","metadata":{"papermill":{"duration":0.011946,"end_time":"2024-03-07T22:00:26.907591","exception":false,"start_time":"2024-03-07T22:00:26.895645","status":"completed"},"tags":[]},"source":["# Fitting ARMA & eGARCH models to Google's Stocks"]},{"cell_type":"markdown","id":"28ae81cc","metadata":{"papermill":{"duration":0.011204,"end_time":"2024-03-07T22:00:26.930185","exception":false,"start_time":"2024-03-07T22:00:26.918981","status":"completed"},"tags":[]},"source":["## Introduction"]},{"cell_type":"markdown","id":"32c030de","metadata":{"papermill":{"duration":0.011036,"end_time":"2024-03-07T22:00:26.952504","exception":false,"start_time":"2024-03-07T22:00:26.941468","status":"completed"},"tags":[]},"source":["In this analysis, we aim to incorporate two powerful time series models, namely Autoregressive Moving Average (ARMA) and Exponential Generalized Autoregressive Conditional Heteroskedasticity (eGARCH), to provide an understanding of Google's stock market performance. The methods and codes are adapted from Perlin, Mastella, Vancin, & Ramos [1].\n","\n","**Objective**\n","\n","Our primary goal is to construct robust models for forecasting, aiming to capture both short-term fluctuations and long-term trends present in Google's stock prices. To achieve this, we leverage the ARMA model to address trends, seasonality, and autocorrelation in the data before applying the eGARCH model to analyze and predict volatility. The models are adjusted with data spanning from January 1, 2019 to December 31, 2022, and then its predictions are compared with the real values from January 1, 2023 to December 31, 2023.\n","\n","**Data Source**\n","\n","We utilize the daily stock price data for Google (Alphabet Inc.) obtained from Yahoo Finance [2]. This dataset spans from January 1, 2019, to December 31, 2023.\n","\n","**Methodology**\n","\n","1. Adjusting the ARMA model: we begin by preprocessing the raw data using the ARMA model to address trends and autocorrelation.\n","\n","2. Adjusting the eGARCH model: we proceed to construct the eGARCH model to capture the conditional variance of Google's stock prices, incorportating the autocorrelation-adjusted data from the ARMA model's residuals to better predict volatility, accounting for both short-term and long-term effects.\n","\n","3. Simulation: we compare the final model's predictions with the actual values from 2023 to validate the accuracy of the model.\n","\n","4. Probabilities: we use the model's predictions to calculate the probability of the stock's values reaching certain thresholds in 2023.\n","\n","**Conclusion**\n","\n","Through the integration of ARMA and eGARCH models, we aim to provide a comprehensive analysis of Google's stock market volatility, offering insights into both short-term fluctuations and long-term trends. By leveraging the strengths of each model and carefully considering their respective contributions, we endeavor to enhance our understanding of the underlying dynamics driving Google's stock prices, thereby facilitating more informed investment decisions."]},{"cell_type":"markdown","id":"82fa7275","metadata":{"papermill":{"duration":0.010968,"end_time":"2024-03-07T22:00:26.97444","exception":false,"start_time":"2024-03-07T22:00:26.963472","status":"completed"},"tags":[]},"source":["## Loading libraries"]},{"cell_type":"code","execution_count":1,"id":"6933c508","metadata":{"execution":{"iopub.execute_input":"2024-03-07T22:00:27.002202Z","iopub.status.busy":"2024-03-07T22:00:26.999678Z","iopub.status.idle":"2024-03-07T22:01:03.712482Z","shell.execute_reply":"2024-03-07T22:01:03.710376Z"},"papermill":{"duration":36.731225,"