tle = element_text(size = 24),\n","    axis.text = element_text(size = 14),\n","    legend.title = element_text(size = 20),\n","    legend.text = element_text(size = 16)\n","  )\n","\n","options(repr.plot.width = 20, repr.plot.height = 10)\n","ggplot(train, aes(x = index(train), y = GOOG.Adjusted)) +\n","  geom_line() +\n","  labs(title = \"Google Stock Price\",\n","       x = \"Date\",\n","       y = \"Price\") +\n","  theme"]},{"cell_type":"markdown","id":"681d0e20","metadata":{"papermill":{"duration":0.015471,"end_time":"2024-03-07T22:01:05.09097","exception":false,"start_time":"2024-03-07T22:01:05.075499","status":"completed"},"tags":[]},"source":["## Diagnosing heteroskedasticity"]},{"cell_type":"markdown","id":"c919de37","metadata":{"papermill":{"duration":0.015546,"end_time":"2024-03-07T22:01:05.122247","exception":false,"start_time":"2024-03-07T22:01:05.106701","status":"completed"},"tags":[]},"source":["The returns and log-returns of a time series are *stationary* and *ergodic*. Stationarity implies that the statistical properties of the series, such as mean and variance, remain constant over time. Ergodicity suggests that the long-term statistical behavior of the series can be inferred from a single, sufficiently long sample. Therefore, by focusing on returns, which capture the percentage change in asset prices over time, we mitigate potential biases arising from non-stationarity and achieve a more stable representation of the underlying dynamics.\n","\n","In this case our attention turns to the assessment of *heteroskedasticity*, which refers to the phenomenon where the variability of the data changes over time. We must detect heteroskedasticity in order to determine that an ARCH model is necessary. We can employ a hypothesis test to ascertain whether heteroskedasticity is present in the log-returns series; in this case, we expect it to be, as this is very common for financial data."]},{"cell_type":"code","execution_count":4,"id":"c743d08c","metadata":{"e