source":["nortsTest::arch.test(train$logret, arch = \"box\")"]},{"cell_type":"markdown","id":"e809b97d","metadata":{"papermill":{"duration":0.018526,"end_time":"2024-03-07T22:01:05.965175","exception":false,"start_time":"2024-03-07T22:01:05.946649","status":"completed"},"tags":[]},"source":["A p-value < 2.2e-16 indicates that the null hypothesis is rejected, and, therefore, the return series is heteroskedastic."]},{"cell_type":"markdown","id":"640d5207","metadata":{"papermill":{"duration":0.020143,"end_time":"2024-03-07T22:01:06.004593","exception":false,"start_time":"2024-03-07T22:01:05.98445","status":"completed"},"tags":[]},"source":["## Finding the components of the ARIMA model"]},{"cell_type":"markdown","id":"1e66cab9","metadata":{"papermill":{"duration":0.018773,"end_time":"2024-03-07T22:01:06.042304","exception":false,"start_time":"2024-03-07T22:01:06.023531","status":"completed"},"tags":[]},"source":["Researchers can visually inspect the time series data to identify patterns. Moving averages or polynomial regression can be applied to quantify and model the trend component. Seasonal subseries plots, seasonal indices, or Fourier analysis can be employed to isolate and quantify the seasonal component. Autocorrelation plots (ACF) and partial autocorrelation plots (PACF) can be used to identify significant lags in the data, which indicate potential autoregressive relationships.\n","\n","With that said, automated methods for identifying the best-fitting models offer significant advantages over manual analysis. While it's essential to complement automated methods with expert domain knowledge to ensure that chosen models align with the underlying data and analysis objectives while avoiding common pitfalls such as overfitting, these methods efficiently explore a wide range of potential models, handling complexities and nuances that may elude human analysts. By providing an objective selection process, they reduce the risk of bias and subjectivity, leading to more reliable and reproducible results. Automated methods also incorporate optimization algorithms to fine-tune model parameters, improving predictive accuracy, particularly in complex or nonlinear data relationships. Their scalability makes them suitable for large datasets or high-frequency data streams where manual analysis may be impractical.\n","\n","Firstly, we define a function that fits an ARIMA + GARCH model with the `rugarch` library [4] and returns the values of the AIC and BIC diagnostics."]},{"cell_type":"code","execution_count":6,"id":"552529de","metadata":{"execution":{"iopub.execute_input":"2024-03-07T22:01:06.084936Z","iopub.status.busy":"2024-03-07T22:01:06.083013Z","iopub.status.idle":"2024-03-07T22:01:06.101813Z","shell.execute_reply":"2024-03-07T22:01:06.099518Z"},"papermill":{"duration":0.044505,"end_time":"2024-03-07T22:01:06.105344","exception":false,"start_time":"2024-03-07T22:01:06.060839","status":"completed"},"tags":[],"vscode":{"languageId":"r"}},"outputs":[],"source":["fit_garch <- function(\n","  x,\n","  ar_lag,\n","  ma_lag,\n","  arch_lag,\n","  garch_lag,\n","  model_type,\n","  distribution_type\n",") {\n","\n","  # Specifies the model\n","  spec <- rugarch::ugarchspec(\n","    variance.model = list(\n","      model = model_type,\n","      garchOrder = c(arch_lag, garch_lag)\n","    ),\n","    mean.model = list(armaOrder = c(ar_lag, ma_lag)),\n","    distribution.model = distribution_type\n","  )\n","\n","  # Creates the model name\n","  model_name <- paste0(\n","    \"ARMA(\", ar_lag, \",\", ma_lag, \") + \", model_type,\n","    \"(\", arch_lag, \",\", garch_lag, \") \", distribution_type\n","  )\n","\n","  # Estimates the model\n","  try({\n","    fit <- rugarch::ugarchfit(spec = spec, data = x)\n","  })\n","\n","  # If the model is estimated, it returns the AIC and BIC\n","  if (!is.null(coef(fit))) {\n","    AIC <- rugarch::infocriteria(fit)[1]\n","    BIC <- rugarch::infocriteria(fit)[2]\n","  } else {\n","    AIC <- NA\n","    BIC <- NA\n","  }\n","\n","  # Returns the results\n","  est_tab <- tibble::tibble(\n","    ar_lag,\n","    ma_lag,\n","    arch_lag,\n","    garch_lag,\n","    AIC = AIC,\n","    BIC = BIC,\n","    model_type = model_type,\n","    distribution_type,\n","    model_name = model_name\n","  )\n","\n","  return(est_tab)\n","}"]},{"cell_type":"markdown","id":"fa9e569b","metadata":{"papermill":{"duration":0.022718,"end_time":"2024-03-07T22:01:06.147155","exception":false,"start_time":"2024-03-07T22:01:06.124437","status":"completed"},"tags":[]},"source":["Then, we use `purrr` to perform a grid search of possible parameter combinations and compare the different results."]},{"cell_type":"code","execution_count":7,"id":"78dfe861","metadata":{"execution":{"iopub.execute_input":"2024-03-07T22:01:06.191156Z","iopub.status.busy":"2024-03-07T22:01:06.189065Z","iopub.status.idle":"2024-03-07T22:02:23.17213Z","shell.execute_reply":"2024-03-07T22:02:23.17011Z"},"papermill":{"duration":77.008384,"end_time":"2024-03-07T22:02:23.174921","exception":false,"start_time":"2024-03-07T22:01:06.166537","status":"completed"},"tags":[],"vscode":{"languageId":"r"}},"outputs":[],"source":["# PARAMETERS\n","max_ar_lag <- 1\n","max_ma_lag <- 1\n","max_arch_lag <- 2\n","max_garch_lag <- 1\n","dist_to_use <- c(\"norm\", \"std\")\n","models_to_estimate <- c(\"sGARCH\", \"eGARCH\", \"gjrGARCH\")\n","\n","# Define the grid\n","grid <- expand_grid(\n","  ar_lag = 0:max_ar_lag,\n","  ma_lag = 0:max_ma_lag,\n","  arch_lag = 1:max_arch_lag,\n","  garch_lag = 1:max_garch_lag,\n","  model_type = models_to_estimate,\n","  distribution_type = dist_to_use\n",")\n","\n","# Perform the grid search\n","results <- purrr::pmap(\n","  .l = list(\n","    x = rep(list(train$logret), nrow(grid)),\n","    ar_lag = grid$ar_lag,\n","    ma_lag = grid$ma_lag,\n","    arch_lag = grid$arch_lag,\n","    garch_lag = grid$garch_lag,\n","    model_type = grid$model_type,\n","    distribution_type = grid$distribution_type\n","  ),\n","  fit_garch\n",")"]},{"cell_type":"markdown","id":"470220ca","metadata":{"papermill":{"duration":0.021292,"end_time":"2024-03-07T22:02:23.217658","exception":false,"start_time":"2024-03-07T22:02:23.196366","status":"completed"},"tags":[]},"source":["Finally, we compare the results using AIC (Akaike Information Criterion) and BIC (Bayesian Information Criterion). These are statistical measures used for model selection, and we aim to minimize their values.\n","- AIC evaluates the trade-off between the goodness of fit of the model and its complexity (number of parameters). It penalizes models for having more parameters, aiming to select the model that provides the best fit with the fewest parameters. Its formula is $AIC = 2k - 2l$, where $l$ is the maximized value of the likelihood function for the model, and k is the number of parameters in the model.\n","- BIC is similar to AIC but places a stronger penalty on models with more parameters. Its foruma is $BIC = k \\ln(n) - 2l$, where $n$ is the sample size."]},{"cell_type":"code","execution_count":8,"id":"260fbfc7","metadata":{"execution":{"iopub.execute_input":"2024-03-07T22:02:23.260212Z","iopub.status.busy":"2024-03-07T22:02:23.258122Z","iopub.status.idle":"2024-03-07T22:02:24.340489Z","shell.execute_reply":"2024-03-07T22:02:24.338376Z"},"papermill":{"duration":1.115623,"end_time":"2024-03-07T22:02:24.352039","exception":false,"start_time":"2024-03-07T22:02:23.236416","status":"completed"},"tags":[],"vscode":{"languageId":"r"}},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAAeACAIAAADFVPvmAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzddUAUaR8H8Gc2WLqRElBBwULswO7uM8+uM87O11bsPuO8M8/T07O7sLG7FQ8V\nQRrpXnbn/WNhdoCN2WUXUL6fv2Zmn3meZ2Yf5tH57fM8FE3TBAAAAAAAAAAAAAAAAABKB15x\nVwAAAAAAAAAAAAAAAAAAig4ChAAAAAAAAAAAAAAAAAClCAKEAAAAAAAAAAAAAAAAAKUIAoQA\nAAAAAAAAAAAAAAAApQgChAAAAAAAAAAAAAAAAAClCAKEAAAAAAAAAAAAAAAAAKUIAoQAAAAA\nAAAAAAAAAAAApYiguCsAAFDiSDKjb1z0v3fv/v0Hjz6FxcTFxyckJPNExqampvYuFTw9Pev6\ntmzXvr1PeevirimUUpLM6A