","    distribution_type,\n","    AIC, BIC\n","  ),\n","  cols = c(\"AIC\", \"BIC\")\n",")\n","\n","# Define the best models\n","model_names <- unique(long$model_name)\n","best_models <- c(\n","  tab_results$model_name[which.min(tab_results$AIC)],\n","  tab_results$model_name[which.min(tab_results$BIC)]\n",")\n","long <- long %>%\n","  mutate(\n","    order_model = if_else(\n","      model_name %in% best_models, \"Best Model\", \"Not Best Model\"\n","    )\n","  ) %>%\n","  na.omit()\n","\n","# Create a table with the best models\n","best_models <- long %>%\n","  group_by(name) %>%\n","  summarise(\n","    model_name = model_name[which.min(value)],\n","    value = value[which.min(value)],\n","    model_type = model_type[which.min(value)]\n","  )\n","\n","# Plot results\n","options(repr.plot.width = 20, repr.plot.height = 16)\n","ggplot(\n","  long %>% arrange(model_type), aes(\n","    x = reorder(model_name, order(model_type)),\n","    y = value,\n","    shape = distribution_type,\n","    color = model_type\n","  )\n",") +\n","  geom_point(size = 3.5, alpha = 0.65) +\n","  coord_flip() +\n","  facet_wrap(~name, scales = \"free_x\") +\n","  geom_point(\n","    data = best_models,\n","    mapping = aes(x = reorder(model_name, order(model_type)), y = value),\n","    color = \"blue\", size = 5, shape = 8\n","  ) +\n","  labs(\n","    title = \"Selecting Garch Models by Fitness Criteria\",\n","    subtitle = \"The best model is the one with \\nlowest AIC or BIC (with star)\",\n","    x = \"\",\n","    y = \"Value of Fitness Criteria\",\n","    shape = \"Type of Dist.\",\n","    color = \"Type of Model\"\n","  ) +\n","  theme(legend.position = \"right\") +\n","  theme\n"]},{"cell_type":"markdown","id":"6f580208","metadata":{"papermill":{"duration":0.0297,"end_time":"2024-03-07T22:02:24.411455","exception":false,"start_time":"2024-03-07T22:02:24.381755","status":"completed"},"tags":[]},"source":["As we can see, the choice of distribution is extremely important for the goodness of fit of a model. Student-t adjusted models performed significantly better than Normal adjusted models. It is also clear that eGARCH models performed better than their counterparts.\n","\n","eGARCH, or Exponential Generalized Autoregressive Conditional Heteroskedasticity, is a type of statistical model commonly used in econometrics and financial time series analysis where the conditional variance of the time series is modeled using an exponential function of past error terms, rather than a linear function as in the GARCH model. This exponential formulation allows for greater flexibility in capturing the dynamics of volatility clustering and asymmetry. In many economic and financial time series, volatility tends to increase more in response to negative shocks (such as financial crises) than to positive shocks (such as economic booms); eGARCH can capture this asymmetry by allowing different parameters for positive and negative shocks.\n","\n","The best models, according to the AIC and BIC criterions, are, respectivelly, ARMA(1, 1) + eGARCH(1, 1) and ARMA(0, 0) + eGARCH(1, 1), both with Student-t distribution. What this means is that there is a trend and autoregression in the log-return series, but not they are not significant enough to be included in a simplified model according to the BIC."]},{"cell_type":"markdown","id":"1c651460","metadata":{"papermill":{"duration":0.028554,"end_time":"2024-03-07T22:02:24.467972","exception":false,"start_time":"2024-03-07T22:02:24.439418","status":"completed"},"tags":[]},"source":["## Simulating the behavior of Google's stocks"]},{"cell_type":"markdown","id":"14e134ad","metadata":{"papermill":{"duration":0.027604,"end_time":"2024-03-07T22:02:24.522005","exception":false,"start_time":"2024-03-07T22:02:24.494401","status":"completed"},"tags":[]},"source":["First, we choose a model according to one of the criterions. Using the AIC, we choose an ARMA(1, 1) + eGARCH(1, 1) with Student-t distribution."]},{"cell_type":"code","execut