BAAAAAAAAAAAABRCgRAAAAAAAAAAAABQCAVCAAAAAAAAAAAAQCH/Dy/lKyfu394L\nAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"height":600,"width":1200}},"output_type":"display_data"}],"source":["options(repr.plot.width = 20, repr.plot.height = 10)\n","\n","ggplot() +\n","  geom_point(\n","    data = sim_prices,\n","    aes(x = date, y = price),\n","    color = \"grey\",\n","    shape = 4, # x shape\n","    alpha = 0.01,\n","    na.rm = TRUE\n","  ) +\n","  geom_line(\n","    data = test,\n","    aes(x = index(test), y = GOOG.Adjusted),\n","    color = \"blue\",\n","    linewidth = 1.5\n","  ) +\n","  labs(\n","    title = \"Price Projections of Google Stock (GOOG)\",\n","    subtitle = paste0(\n","      \"Total of \",\n","      sim_amount,\n","      \" simulations based on an ARMA+eGARCH model selected by BIC\"\n","    ),\n","    caption = \"Data from Yahoo Finance\",\n","    x = \"\",\n","    y = \"Value\"\n","  ) +\n","  ylim(c(0.75*min(test$GOOG.Adjusted), 1.25*max(test$GOOG.Adjusted))) +\n","  scale_x_date(date_labels = \"%Y-%m\", date_breaks = \"1 month\") +\n","  theme"]},{"cell_type":"markdown","id":"09a47054","metadata":{"papermill":{"duration":0.055172,"end_time":"2024-03-07T22:03:15.689956","exception":false,"start_time":"2024-03-07T22:03:15.634784","status":"completed"},"tags":[]},"source":["The model's predictions exhibit a phenomenon where the spread of outcomes is relatively narrow at the beginning of the forecast horizon but gradually widens as time progresses. This pattern reflects the inherent uncertainty and volatility present in financial markets, where short-term predictions may have comparatively lower variability but long-term forecasts are subject to a wider range of potential outcomes. Understanding and accounting for this widening spread is crucial for risk management and decision-making in financial modeling and investment strategies. Consequently, the model should be updated frequently, allowing for adjustments to reflect evolving market conditions and ensuring the reliability of forecasts over time.\n","\n","With that said, it's observed that the real stock prices generally correspond to their expected predictions generated by the ARMA + eGARCH model, except for a notable deviation between mid January and mid February. This discrepancy underscores an important aspect of the model's limitations: its inability to detect short-term large variations in stock prices accurately. However, it's essential to recognize that stock prices commonly exhibit a long-term trend that is often disconnected from their short-term fluctuations; as such, the model does provide valuable insights into long-term patterns and volatility dynamics.\n","\n","For those curious on what happened between January and March, this is the time frame where \"stocks moved higher again as investors wait for Wednesday’s likely interest rate hike announcement from the Federal Reserve\", according to CNN Business [5], and then \"Alphabet shares dive after Google AI chatbot Bard flubs answer in ad\", according to Reuters [6]. These events exemplify the dynamic and unpredictable nature of the financial market, where factors beyond traditional modeling parameters can exert substantial impacts on stock prices. Such occurrences underscore the inherent challenge of incorporating all relevant variables into predictive models and highlight the importance of staying abreast of current events and market sentiment for effective decision-making in financial markets.\n","\n","An intriguing aspect worth noting is that despite the downward trend in the stock price since 2022, the model predicted a rise in the stock price for 2023, and remarkably, this prediction turned out to be correct. This instance underscores the model's potential to capture long-term shifts or reversals in stock price movements, even amidst prevailing trends."]},{"cell_type":"markdown","id":"41dd4827","metadata":{"papermill":{"duration":0.051515,"end_time":"2024-03-07T22:03:15.79346","exception":false,"start_time":"2024-03-07T22:03:15.741945","status":"completed"},"tags":[]},"source":["## Predicting values"]},{"cell_type":"markdown","id":"1077dc50","metadata":{"papermill":{"duration":0.051464,"end_time":"2024-03-07T22:03:15.897555","exception":false,"start_time":"2024-03-07T22:03:15.846091","status":"completed"},"tags":[]},"source":["We can also use the model to calculate the propability that the stocks will reach a certain price on a certain time frame by checking how many of the simulations got to this price. For example, let's see if the model expects that at any point of 2023, the price will reach US$100."]},{"cell_type":"code","execution_count":12,"id":"ce2c7492","metadata":{"execution":{"iopub.execute_input":"2024-03-07T22:03:16.010319Z","iopub.status.busy":"2024-03-07T22:03:16.008518Z","iopub.status.idle":"2024-03-07T22:03:16.657764Z","shell.execute_reply":"2024-03-07T22:03:16.654513Z"},"papermill":{"duration":0.714392,"end_time":"2024-03-07T22:03:16.664446","exception":false,"start_time":"2024-03-07T22:03:15.950054","status":"completed"},"tags":[],"vscode":{"languageId":"r"}},"outputs":[{"name":"stderr","output_type":"stream","text":["Warning message:\n","“\u001b[1m\u001b[22mUsing `size` aesthetic for lines was deprecated in ggplot2 3.4.0.\n","\u001b[36mℹ\u001b[39m Please use `linewidth` instead.”\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAASwCAIAAADwxubWAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZWATSRsA4NlY3b3UKS4tHG7FHYr7IYfL4XaHu9sd+uEcdsBBcdfi7lpKW+qS\nusX2+5F2s7HNJs1mS3mfX9lkdmay2cwm8+7MYDiOIwAAAAAAAAAAAAAAAAAAAADAz4HDdgUA\nAAAAAAAAAAAAAAAAAAAAAKYDAUIAAAAAAAAAAAAAAAAAAAAAfiIQIAQAAAAAAAAAAAAAAAAA\nAADgJwIBQgAAAAAAAAAAAAAAAAAAAAB+IhAgBAAAAAAAAAAAAAAAAAAAAOAnAgFCAAAAAAAA\nAAAAAAAAAAAAAH4iECAEAAAAAAAAAAA0S3o01N/f39/fv9noB2zXBQAAAAAAAACMhsd2BQAA\ngB3SwuRHt+/eu3fvwYPHkfGpQqFQKBRKeVYODg4ODg6+lYLq169Xv0Hj1o1r8jC26wp+fNLC\n5FuXrj548PDhoyeRcSnC9PSMjGyOmaW1tbWbd0ClSpXqNm7Zrn37YH9HtmsKWMZK0yQTC8Mv\nX7l9+9bTVx++REQkC7Oyc/J55lbWNnZefuUrVKzSoGlIyzYdg