.5)),\n","      first(which(probabilities$prob > 0.75)),\n","      first(which(probabilities$prob > 0.90))\n","    ),\n","    date = probabilities$date[idx],\n","    prob = probabilities$prob[idx],\n","    text = paste0(format(date, \"%d/%m/%Y\"), \"\\nprob = \", scales::percent(prob))\n","  )\n","\n","  p <- ggplot(probabilities, aes(x = date, y = prob)) +\n","    geom_line(size = 2) +\n","    labs(\n","      title = paste0(\"Probability of Google's Stocks (GOOG) getting to US$ \", expected_price), #nolint\n","      subtitle = \"Calculations based on simulations of an ARMA+eGARCH model selected by BIC\", #nolint\n","      x = \"Date\",\n","      y = \"Probability\"\n","    ) +\n","    geom_point(\n","      data = breakpoints,\n","      aes(x = date, y = prob),\n","      size = 5,\n","      color = \"red\"\n","    ) +\n","    geom_text(\n","      data = breakpoints,\n","      aes(x = date, y = prob, label = text),\n","      nudge_x = nrow(probabilities) * 0.085,\n","      nudge_y = -0.05,\n","      color = \"red\", check_overlap = TRUE\n","    ) +\n","    ylim(c(0, 1)) +\n","    scale_x_date(date_labels = \"%Y-%m\", date_breaks = \"1 month\") +\n","    theme\n","\n","    return(p)\n","}\n","\n","expected_price <- 100\n","\n","probabilities <- sim_prices %>%\n","  group_by(date) %>%\n","  summarize(prob = sum(price >= expected_price) / sim_amount)\n","\n","plot_probabilities(probabilities, expected_price)"]},{"cell_type":"markdown","id":"202fd930","metadata":{"papermill":{"duration":0.059404,"end_time":"2024-03-07T22:03:16.787131","exception":false,"start_time":"2024-03-07T22:03:16.727727","status":"completed"},"tags":[]},"source":["We can see that the model had high expectations for a long-term rise in the price of Google's stocks in 2023.\n","\n","We can also do the opposite: calculate the probability of the prices falling below a certain threshold."]},{"cell_type":"code","execution_count":13,"id":"2080ec25","metadata":{"execution":{"iopub.execute_input":"2024-03-0